impl Serialize<3> for SideEffectLinkedToNoteHash {
    fn serialize(self) -> [Field; 3] {
        [self.value, self.note_hash, self.counter as Field]
    }
}

impl Deserialize<3> for SideEffectLinkedToNoteHash {
